window.bookSummaryJSON = "<p>Caden Bosch is on a ship that's headed for the deepest point on Earth: Challenger Deep, the southern part of the Marianas Trench. </p> <p>Caden Bosch is a brilliant high school student whose friends are starting to notice his odd behavior. </p> <p>Caden Bosch is designated the ship's artist in residence, to document the journey with images. </p> <p>Caden Bosch pretends to join the school track team but spends his days walking for miles, absorbed by the thoughts in his head. </p> <p>Caden Bosch is split between his allegiance to the captain and the allure of mutiny. </p> <p>Caden Bosch is torn. </p> <p>A captivating and powerful novel that lingers long beyond the last second, <i>Challenger Deep</i> is a heartfelt tour de force by one of today's most admired writers for teens.</p>"; 
